-- ========================================================================
-- DROP EXISTING TABLES (if needed - uncomment to use)
-- ========================================================================
DROP TABLE IF EXISTS surveys CASCADE;
DROP TABLE IF EXISTS registrations CASCADE;
DROP TABLE IF EXISTS donations CASCADE;
DROP TABLE IF EXISTS milestones CASCADE;
DROP TABLE IF EXISTS event_instances CASCADE;
DROP TABLE IF EXISTS event_definitions CASCADE;
DROP TABLE IF EXISTS participants CASCADE;

-- ========================================================================
-- CREATE TABLES (ALL COLUMNS NULLABLE)
-- ========================================================================

CREATE TABLE event_definitions (
    event_definition_id INTEGER PRIMARY KEY,
    event_name VARCHAR(255),
    event_type VARCHAR(50),
    event_description TEXT,
    event_recurrence_pattern VARCHAR(50),
    event_default_capacity DECIMAL(10, 1)
);

CREATE TABLE participants (
    participant_id INTEGER PRIMARY KEY,
    participant_email VARCHAR(255),
    participant_first_name VARCHAR(100),
    participant_last_name VARCHAR(100),
    participant_dob DATE,
    participant_role VARCHAR(50),
    participant_phone VARCHAR(20),
    participant_city VARCHAR(100),
    participant_state VARCHAR(2),
    participant_zip DECIMAL(10, 1),
    participant_school_or_employer VARCHAR(255),
    participant_field_of_interest VARCHAR(50),
    participant_password VARCHAR(255)
);

CREATE TABLE event_instances (
    event_instance_id INTEGER PRIMARY KEY,
    event_definition_id INTEGER REFERENCES event_definitions(event_definition_id),
    event_date_time_start TIMESTAMP,
    event_date_time_end TIMESTAMP,
    event_location VARCHAR(255),
    event_capacity DECIMAL(10, 1),
    event_registration_deadline TIMESTAMP
);

CREATE TABLE registrations (
    registration_id INTEGER PRIMARY KEY,
    participant_id INTEGER REFERENCES participants(participant_id),
    event_instance_id INTEGER REFERENCES event_instances(event_instance_id),
    registration_status VARCHAR(50),
    registration_attended_flag BOOLEAN,
    registration_check_in_time TIMESTAMP,
    registration_created_at TIMESTAMP
);

CREATE TABLE milestones (
    milestone_id INTEGER PRIMARY KEY,
    participant_id INTEGER REFERENCES participants(participant_id),
    milestone_title VARCHAR(255),
    milestone_date DATE
);

CREATE TABLE donations (
    donation_id INTEGER PRIMARY KEY,
    participant_id INTEGER REFERENCES participants(participant_id),
    donation_date DATE,
    donation_amount DECIMAL(10, 2)
);

CREATE TABLE surveys (
    survey_id INTEGER PRIMARY KEY,
    registration_id INTEGER REFERENCES registrations(registration_id),
    survey_satisfaction_score INT,
    survey_usefulness_score INT,
    survey_instructor_score INT,
    survey_recommendation_score INT,
    survey_overall_score DECIMAL(3, 2),
    survey_nps_bucket VARCHAR(50),
    survey_comments TEXT,
    survey_submission_date TIMESTAMP
);

